B.ml=new A.aL("ACORDO JUDICIAL OU EXTRA JUDICIAL","Existindo a possibilidade um acordo judicial ou extrajudicial para encerrar o lit\xedgio causado pela presta\xe7\xe3o de servi\xe7os profissionais do segurado, o seguro pagar\xe1 o acordo diretamente ao terceiro reclamante, limitado ao valor da cobertura contratada e com pr\xe9vio consentimento da seguradora na hora da defini\xe7\xe3o do valor acordado.",null)
B.mk=new A.aL("CONDENA\xc7\xc3O JUDICIAL","Caso o segurado seja condenado judicialmente, por decis\xe3o judicial transitado em julgado ou decis\xe3o final proferida por tribunal arbitral, ou seja, sem a possibilidade de recorrer da decis\xe3o, as indeniza\xe7\xf5es a t\xedtulo de dano material ou moral ser\xe3o integralmente pagas at\xe9 o limite m\xe1ximo de indeniza\xe7\xe3o contratado.",null)
B.mg=new A.aL("RESSARCIMENTOS","Se o segurado for Notificado ou tomar conhecimento de algum fato causado pela presta\xe7\xe3o dos servi\xe7os profissionais, que possam acarretar uma reclama\xe7\xe3o futura por parte do Terceiro, o segurado poder\xe1 acionar o seguro e caracterizada a cobertura, o ressarcimento \xe9 feito sem a necessidade de a\xe7\xe3o judicial ou mesmo reclama\xe7\xe3o formal. M\xc9DICOS",null)
B.mh=new A.aL("DANOS \xc0 REPUTA\xc7\xc3O","Caso o segurado sofra um dano \xe0 sua reputa\xe7\xe3o decorrente da sua presta\xe7\xe3o de servi\xe7o profissional, o seguro cobrir\xe1 as despesas necess\xe1rias para assessoria de imprensa e assessoria de reabilita\xe7\xe3o de imagem, para a preserva\xe7\xe3o da reputa\xe7\xe3o do segurado.",null)
B.mn=new A.aL("CUSTAS EMERGENCIAIS","Caso o segurado tenha que fazer qualquer tipo de contrata\xe7\xe3o ou pagamento de forma intempestiva com o intuito de mitigar ou minorar os poss\xedveis impactos de um sinistro e que n\xe3o haja tempo h\xe1bil de comunicar a seguradora, a seguradora far\xe1 o devido reembolso de tais despesas.",null)
B.mf=new A.aL("CAL\xdaNIA, INJ\xdaRIA E DIFAMA\xc7\xc3O","Caso algum terceiro entenda que o Segurado praticou algum ato de cal\xfania, inj\xfaria ou difama\xe7\xe3o de forma involunt\xe1ria durante a presta\xe7\xe3o de seus servi\xe7os, o seguro cobrir\xe1 as despesas de defesa para este tipo de situa\xe7\xe3o, bem como far\xe1 o pagamento da indeniza\xe7\xe3o, caso seja necess\xe1rio.",null)
B.mi=new A.aL("PAGAMENTOS SUPLEMENTARES","Caso o Segurado precise comparecer a uma audi\xeancia ou julgamento durante o processo de regul\xe7\xe3o de sinistro, o seguro pagar\xe1 as despesas do segurado para atender tal solicita\xe7\xe3o.",null)
B.mm=new A.aL("HONOR\xc1RIOS RETIDOS","Se o terceiro entender que o servi\xe7o prestado pelo Segurado causou algum dano e se recusar a pagar os honor\xe1rios devidos ou caso o mesmo desista acionar o seguro na justi\xe7a e o segurado concorde em isent\xe1-lo dos honor\xe1rios devidos, o seguro pagar\xe1 o preju\xedzo pelo n\xe3o recebimento dos honor\xe1rios.",null)
