B.xX=new A.aL("INFEC\xc7\xc3O HOSPITALAR","Caso o segurado seja envolvido em demanda judicial decorrente alegada Infec\xe7\xe3o Hospitalar, nos termos das defini\xe7\xf5es pela Ag\xeancia Nacional de Vigil\xe2ncia Sanit\xe1ria \u2013 ANVISA, contra\xedda por um paciente sob responsabilidade do segurado, o presente seguro cobrir\xe1 as despesas de defesa do segurado e eventuais condena\xe7\xf5es que sejam imputadas ao segurado.",null)
B.xI=new A.aL("CHEFE DE EQUIPE OU DIRETOR M\xc9DICO","Caso o segurado sofra uma reclama\xe7\xe3o por alegado ato m\xe9dico que tenha causado dano, pela sua condi\xe7\xe3o de chefe de equipe ou diretor m\xe9dico, diretor cl\xednico ou posi\xe7\xe3o similar, o presente seguro cobrir\xe1 o segurado, nos termos dos riscos cobertos da presente ap\xf3lice, mesmo que o ato m\xe9dico tenha sido praticado por outro profissional sob responsabilidade do segurado.",null)
B.yh=new A.aL("COBERTURA EXTENSIVA PARA A PESSOA JUR\xcdDICA","Caso o segurado possua uma empresa aberta para o desempenho de suas atividades profissionais e esta empresa sofra uma reclama\xe7\xe3o por alegado ato m\xe9dico praticado pelo segurado, o seguro cobrir\xe1 tamb\xe9m as reclama\xe7\xf5es apresentadas contra a pessoa jur\xeddica.",null)
