B.xN=new A.aL("Despesas m\xe9dicas, Viagem Nacional","Despesas m\xe9dicas, hospitalares e/ou odontol\xf3gicas em viagem nacional (DMHO viagem nacional)\u2013 Esta cobertura garante indeniza\xe7\xe3o das despesas m\xe9dicas, hospitalares ou odontol\xf3gicas devido acidente pessoal ou doen\xe7a s\xfabita. Como ela \xe9 destinada para viagens nacionais, voc\xea pode utilizar assim que sair da sua cidade.",null)
B.yb=new A.aL("Despesas m\xe9dicas, Viagem internacional","Despesas m\xe9dicas, hospitalares e/ou odontol\xf3gicas em viagem ao exterior (DMHO viagem internacional)\u2013 Ela garante os mesmos itens da cobertura anterior:  indeniza\xe7\xe3o das despesas m\xe9dicas, hospitalares ou odontol\xf3gicas devido acidente pessoal ou doen\xe7a s\xfabita. A diferen\xe7a \xe9 que, por ser voltada para viagens internacionais, ela come\xe7a a valer assim que voc\xea sair do seu pa\xeds de origem.",null)
B.y5=new A.aL("Traslado m\xe9dico","Garante indeniza\xe7\xe3o das despesas de remo\xe7\xe3o ou transfer\xeancia at\xe9 a cl\xednica ou hospital mais pr\xf3ximo, por motivo de acidente pessoal ou enfermidade coberta. Ou seja, se ocorrer algum acidente que voc\xea precise de locomo\xe7\xe3o at\xe9 um hospital, esta cobertura ir\xe1 cobrir as despesas.",null)
B.y8=new A.aL("Regresso sanit\xe1rio ","Garante indeniza\xe7\xe3o das despesas do translado de volta ao local de origem, caso o mesmo n\xe3o possa voltar como passageiro regular. Ou seja, caso voc\xea sofra um acidente e precise ficar conectado a aparelhos m\xe9dicos, o seguro ir\xe1 cobrir os gastos com essa volta pra casa.",null)
B.y_=new A.aL("Traslado de corpo","Em caso de morte, garante indeniza\xe7\xe3o das despesas com a libera\xe7\xe3o e transporte do corpo do segurado do local da ocorr\xeancia at\xe9 o local de sepultamento.",null)
B.y2=new A.aL("Invalidez por acidente em viagem","Invalidez permanente total ou parcial por acidente em viagem \u2013 Pagamento de indeniza\xe7\xe3o em caso de perda ou redu\xe7\xe3o funcional definitiva, total ou parcial de determinados membros ou \xf3rg\xe3os. Est\xe3o cobertos os acidentes pessoais ocorridos durante a viagem.",null)
B.yt=new A.aL("Morte em viagem ","Garante aos benefici\xe1rios da ap\xf3lice o valor contratado em caso de morte do segurado durante a viagem por motivos naturais ou acidentais.",null)
B.y4=new A.aL("Morte acidental em viagem","Garante aos benefici\xe1rios da ap\xf3lice o valor contratado em caso de morte do segurado por acidente pessoal durante a viagem.",null)
B.ye=new A.aL("Coberturas Adicionais","Mediante Contrata\xe7\xe3o Pr\xe9via \n \n \n Bagagem \u2013 Garante indeniza\xe7\xe3o no caso de extravio, roubo, furto, dano ou destrui\xe7\xe3o da bagagem. Veja o que fazer em caso de mala extraviada. \n \n \n Funeral \u2013 Garante indeniza\xe7\xe3o no caso do falecimento do segurado durante a viagem. \n \n \n Cancelamento de viagem \u2013 Indeniza\xe7\xe3o das despesas de pacotes tur\xedsticos e/ou servi\xe7os de viagem na ocorr\xeancia de evento que impe\xe7a o segurado de prosseguir viagem. \n \n \n Despesas farmac\xeauticas \u2013 Garante reembolso das despesas com medicamentos prescritos por m\xe9dicos devido acidente pessoal ou enfermidade. \n \n \n Assist\xeancia jur\xeddica \u2013 Garante reembolso das despesas com servi\xe7os de advocacia ocasionadas de forma criminal ou responsabilidade civil. \n \n \n Pagamento de fian\xe7a \u2013 Garante reembolso das despesas de fian\xe7a judicial para liberdade provis\xf3ria durante a viagem. \n \n \n Cancelamento ou atraso de voo \u2013 Reembolso referente \xe0s despesas com alimenta\xe7\xe3o e hospedagem no caso de cancelamento ou atraso de voo da companhia a\xe9rea. \n \n \n Seguro de laptops e smartphone \u2013 Garante reembolso de alguma porcentagem do valor da nota fiscal de equipamentos eletr\xf4nicos em caso de roubo, furto qualificado, impacto de ve\xedculos, inc\xeandio, raio ou explos\xe3o durante a viagem. \n \n \n Viagem garantida \u2013 Reembolsa despesas com a viagem no caso de fal\xeancia ou recupera\xe7\xe3o judicial da ag\xeancia de viagens. \n \n \n Assist\xeancia fisioterapia \u2013 Ap\xf3s alta hospitalar durante a viagem, garante ao segurado o tratamento de fisioterapia para reabilita\xe7\xe3o. \n \n \n Prorroga\xe7\xe3o de estadia \u2013 Pagamento ou reembolso das despesas com as di\xe1rias de hot\xe9is no caso da equipe m\xe9dica determinar necessidade de prolongar a estadia devido acidente pessoal ou doen\xe7a s\xfabita. \n \n \n Acompanhante em caso de hospitaliza\xe7\xe3o prolongada \u2013 Garante a passagem de ida e volta de uma pessoa para acompanhar o segurado no caso de hospitaliza\xe7\xe3o devido acidente pessoal ou doen\xe7a s\xfabita.",null)
